import React from "react";
import qs from "query-string";
import { Link as RouterLink } from "react-router-dom";
import { Box, Button, Container, Typography, useTheme, useMediaQuery, makeStyles } from "@material-ui/core";
import Page from "src/components/Page";

const useStyles = makeStyles((theme) => ({
	root: {
		backgroundColor: theme.palette.background.dark,
		minHeight: "100%",
		display: "flex",
		alignItems: "center",
		padding: theme.spacing(3),
		paddingTop: 80,
		paddingBottom: 80,
	},
	image: {
		maxWidth: "100%",
		width: 560,
		maxHeight: 300,
		height: "auto",
	},
}));

function OAuth2(props) {
	const classes = useStyles();
	const theme = useTheme();
	const mobileDevice = useMediaQuery(theme.breakpoints.down("sm"));

	const { location } = props;
	let { code } = qs.parse(location.search);
	console.log(code);

	return (
		<Page className={classes.root} title="404: Not found">
			<Container maxWidth="lg">
				<Typography align="center" variant={mobileDevice ? "h4" : "h1"} color="textPrimary">
					OAuth2 Page
				</Typography>
			</Container>
		</Page>
	);
}

export default OAuth2;
